import { Card, Grid, Modal, TextField } from "@mui/material";
import React, { useState } from "react";

export default function NewGroupModal({ show, toggle }) {
  const [groupName, setGroupName] = useState("");
  const [groupMin, setGroupMin] = useState("");
  const [groupCount, setGroupCount] = useState("");
  return (
    <Modal open={show} onClose={toggle} sx={modalStyle}>
      <Card>
        <Grid container columnGap={3}>
          <Grid item>
            <TextField
              label="Group Name"
              value={groupName}
              onChange={(e) => setGroupName(e.target.value)}
            />
          </Grid>
          <Grid item>
            <TextField
              label="Lowest Number"
              value={groupMin}
              onChange={(e) => setGroupMin(e.target.value)}
            />
          </Grid>
          <Grid item>
            <TextField
              label="Group Count"
              value={groupCount}
              onChange={(e) => setGroupCount(e.target.value)}
            />
          </Grid>
        </Grid>
      </Card>
    </Modal>
  );
}

const modalStyle = {
  width: "600px",
  maxWidth: "90vw",
};
